import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'; // Import BrowserRouter and other necessary components
import Login from './components/Login';
import Register from './components/Register';
import Products from './components/product/Products';
import ProductDetail from './components/product/ProductDetail';
import Createproduct from './components/product/CreateProduct';
import Profile from './components/profile/Profile';
import IncomingOrder from './components/order/IncomingOrder';

ReactDOM.render(
  <React.StrictMode>
    <Router>
      <Routes> {/* Use Routes component to define routes */}
        <Route path="/" element={<Login />} />
        <Route path="/login" element={<Login />} />
        <Route path="/register" element={<Register />} />
        <Route path="/product" element={<Products />} />
        <Route path="/product/:productId" element={<ProductDetail />} />
        <Route path="/products/create" element={<Createproduct />} />
        <Route path="/profile" element={<Profile />} />
        <Route path="/order" element={<IncomingOrder />} />
      </Routes>
    </Router>
  </React.StrictMode>,
  document.getElementById('root')
);

reportWebVitals();


// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
